const Skills = ({ competences }) => {
    return (
      <div>
        <ul class="max-w-md space-y-1 list-inside ">
          {competences.map((competence, index) => (
            <li class="text-center" key={index}>{competence.nom} - {competence.niveau}</li>
          ))}
        </ul>
      </div>
    );
  };

  export default Skills;
